import React, { useState, useEffect, useRef } from 'react';
import photo from './assets/sneha.jpg'; // Adjust the path if needed
import './App.css'; // Make sure your styles are included

const BirthdayPage = () => {
  const [started, setStarted] = useState(false);
  const [showContinuePage, setShowContinuePage] = useState(false);
  const [timeLeft, setTimeLeft] = useState({ days: '--', hours: '--', minutes: '--', seconds: '--' });
  const [musicPlaying, setMusicPlaying] = useState(false);
  const [balloons, setBalloons] = useState([]);
  const [countdownOver, setCountdownOver] = useState(false);
  const audioRef = useRef(null);
  const confettiRef = useRef(null);
  const sparklesRef = useRef(null);

  useEffect(() => {
    const target = new Date('2025-05-25T00:00:00'); // Change to actual birthday
    const timerId = setInterval(() => {
      const now = new Date();
      const diff = target - now;
      if (diff <= 0) {
        clearInterval(timerId);
        setTimeLeft({ days: '00', hours: '00', minutes: '00', seconds: '00' });
        setCountdownOver(true);
        return;
      }
      setTimeLeft({
        days: String(Math.floor(diff / (1000 * 60 * 60 * 24))).padStart(2, '0'),
        hours: String(Math.floor((diff / (1000 * 60 * 60)) % 24)).padStart(2, '0'),
        minutes: String(Math.floor((diff / (1000 * 60)) % 60)).padStart(2, '0'),
        seconds: String(Math.floor((diff / 1000) % 60)).padStart(2, '0'),
      });
    }, 1000);
    return () => clearInterval(timerId);
  }, [started]);

  const launchConfetti = () => {
    if (!confettiRef.current) return;
    const colors = ['#FF9AD3', '#FFA1A1', '#FFB2E9', '#FDB9DB', '#FF6D91'];
    const container = confettiRef.current;
    container.innerHTML = '';
    for (let i = 0; i < 600; i++) {
      const div = document.createElement('div');
      div.className = 'confetti-piece';
      div.style.backgroundColor = colors[i % colors.length];
      div.style.top = Math.random() * 20 + 'vh';
      div.style.left = Math.random() * 100 + 'vw';
      const size = 5 + Math.random() * 7;
      div.style.width = size + 'px';
      div.style.height = size + 'px';
      div.style.animationDuration = (3 + Math.random() * 2) + 's';
      div.style.animationDelay = Math.random() * 0.7 + 's';
      container.appendChild(div);
      div.addEventListener('animationend', () => div.remove());
    }
  };

  const launchBalloons = () => {
    const colors = ['#FF69B4', '#FFD700', '#87CEFA', '#FFA07A', '#98FB98'];
    const newBalloons = Array.from({ length: 20 }, (_, i) => ({
      id: i,
      color: colors[Math.floor(Math.random() * colors.length)],
      left: Math.random() * 100,
      size: 40 + Math.random() * 30,
      delay: Math.random() * 2,
    }));
    setBalloons(newBalloons);
  };

  const launchSparkles = () => {
    if (!sparklesRef.current) return;
    const colors = ['#ffc0d8', '#ffd6e8', '#ffeaf5'];
    for (let i = 0; i < 60; i++) {
      const sparkle = document.createElement('div');
      sparkle.className = 'sparkle sparkle-animate';
      sparkle.style.left = Math.random() * 100 + 'vw';
      sparkle.style.top = Math.random() * 100 + 'vh';
      const size = 2 + Math.random() * 2;
      sparkle.style.width = sparkle.style.height = size + 'px';
      sparkle.style.background = colors[Math.floor(Math.random() * colors.length)];
      sparkle.style.animationDelay = Math.random() * 7 + 's';
      sparklesRef.current.appendChild(sparkle);
      sparkle.addEventListener('animationend', () => sparkle.remove());
    }
  };

  const start = () => {
    setStarted(true);
    launchConfetti();
    launchBalloons();
    launchSparkles();
    if (audioRef.current) {
      audioRef.current.volume = 0.6;
      audioRef.current.play().catch(err => console.warn('Audio play failed:', err));
      setMusicPlaying(true);
    }
  };

  const toggleMusic = () => {
    if (!audioRef.current) return;
    if (musicPlaying) {
      audioRef.current.pause();
      setMusicPlaying(false);
    } else {
      audioRef.current.play();
      setMusicPlaying(true);
    }
  };

  const continueToNextPage = () => {
    setShowContinuePage(true);
  };

  return (
    <>
      <div className="countdown-top" aria-live="polite" aria-atomic="true" tabIndex={0}>
        <div className="countdown-label">Countdown to Sneha's 17th Birthday</div>
        <div className="countdown-timer">
          <span>{timeLeft.days}d</span> : <span>{timeLeft.hours}h</span> : <span>{timeLeft.minutes}m</span> : <span>{timeLeft.seconds}s</span>
        </div>
        {started &&
          <button
            aria-label={musicPlaying ? 'Pause background music' : 'Play background music'}
            onClick={toggleMusic}
            className="music-toggle"
            aria-pressed={musicPlaying}
          >
            {musicPlaying ? 'üîä' : 'üîá'}
          </button>}
      </div>

      <div className="app-container enhanced-bg">
        <div ref={confettiRef} className="confetti-wrapper" aria-hidden="true" />
        <div className="balloons-wrapper">
          {started && balloons.map(balloon => (
            <div
              key={balloon.id}
              className="balloon-float"
              style={{
                left: `${balloon.left}%`,
                animationDelay: `${balloon.delay}s`,
                animationDuration: `${10 + Math.random() * 8}s`,
              }}
            >
              <div className="tail" />
              <div
                className="balloon"
                style={{
                  backgroundColor: balloon.color,
                  width: `${balloon.size}px`,
                  height: `${balloon.size * 1.2}px`,
                }}
              />
            </div>
          ))}
        </div>
        <div ref={sparklesRef} className="sparkles-wrapper" aria-hidden="true" />

        {!started && !showContinuePage &&
          <button
            className="magic-button"
            onClick={start}
            aria-label="Start the birthday surprise"
            disabled={!countdownOver}
            style={{
              opacity: countdownOver ? 1 : 0.5,
              cursor: countdownOver ? 'pointer' : 'not-allowed'
            }}
          >
            <img src="gift.png" alt="Gift" className="gift-icon" />
          </button>
        }

        {started && !showContinuePage && (
          <>
            <h1 className="main-title glow-text" tabIndex={0}>
              üéâ Happy 17th Birthday Sneha !! üéâ
            </h1>
            <div className="about-section">
              <div className="poem" aria-live="polite" tabIndex={0}>
                {[
                  "It‚Äôs been just a year ‚Äî not that long,",
                  "But somehow it feels like we‚Äôve been friends all along.",
                  "You love your novels ‚Äî Agatha‚Äôs the queen,",
                  "Plot twists so wild, they belong on the screen.",
                  "While I‚Äôm halfway lost by page twenty-two,",
                  "You‚Äôre solving crimes like, ‚ÄúToo easy, boo.‚Äù üòéüîç",
                  "Taylor Swift‚Äôs always looping in your mind,",
                  "And every now and then, that one track plays...",
                  <>You‚Äôve got that look ‚Äî <em>like you never go out of Style</em> üòâüé∂</>,
                  "And sleep? Oh please ‚Äî your ride or die,",
                  "If napping were a sport, you‚Äôd qualify. üò¥üí§",
                  "Then there‚Äôs lab practicals, oh what a ride,",
                  "Us pretending we‚Äôve got reactions under control (we lied).",
                  "Panic, notes, and that last-minute cram ‚Äî",
                  "But we passed, somehow ‚Äî thank the exam.",
                  "I‚Äôm just glad we met ‚Äî honestly, truly,",
                  "Class is better with you ‚Äî fun and unruly.",
                  "Best classmate ever ‚Äî that‚Äôs you, not me. üí´"
                ].map((line, i) => (
                  <p key={i} className="glow-text fade-in" style={{ animationDelay: 1 + i * 0.3 + 's' }}>
                    {line}
                  </p>
                ))}
              </div>
              <div className="sneha-photo" tabIndex={0} role="region" aria-label="About Sneha Pradhan">
                <img src={photo} alt="Sneha" style={{ width: '370px', height: 'auto', borderRadius: '10px' }} />
              </div>
            </div>
          </>
        )}
        {started && !showContinuePage && (
        <>
          {/* Your birthday message & photo here */}

          <button
            className="continue-button"
            onClick={continueToNextPage}
            aria-label="Continue to the next page"
          >
            Continue
          </button>
        </>
      )}
      </div>
      <audio ref={audioRef} src="/music.mp3" loop preload="auto" />
    </>
  );
};

export default BirthdayPage;
